import React from 'react';
import './style.css';

const Footer = () => {
    return(
    <>
    <section className="contact" id="contact">
            <h2>CONTACT</h2>
            <p>Say hi to</p>
            <p className="email">mariasofiaestevez@gmail.com</p>
    </section>
    </>
    )
}

export default Footer;
